import React, {Component} from 'react';
import { ListGroup, ListGroupItem, } from 'reactstrap';
import { BrowserRouter, Link } from "react-router-dom";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import AOS from 'aos';
import 'aos/dist/aos.css';







class ConstructionService  extends Component {


    render(){
        return(
            <div className="construction_service">
                <div className="container">
                    <h3 className="service_title text-capitalize font-weight-bold text-center pb-3" data-aos="fade-up">Construction Service</h3>
                    <ListGroup>
                        <ListGroupItem className="sevice_grid border-0"  data-aos="fade-left">
                          
                            <div className="service_photo">
                                <img src='images/images/building_construction.png' alt="Service"/>
                            </div>
                            <div className="text_content">
                                <h4 className="title text-capitalize font-weight-bold mt-3 text-center">Industrial Building Contractors</h4>
                                <p className="des">We provide industrial building constructions services, building architecture, building repair, building maintenance etc.</p>
                                <BrowserRouter>
                                    <Link className="book_now" to="#">Book Now</Link>
                                </BrowserRouter>
                            </div>

                        </ListGroupItem>
                        
                    </ListGroup>
                 </div>
            </div>

            
        );

        
    }

}
export default  ConstructionService;
